import React, { useState } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import {useSpring, animated} from 'react-spring';
import { makeStyles } from '@material-ui/core/styles';
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';

const useStyles = makeStyles({
  pTag: {
    margin: "0 auto",
    textAlign: "center",
    padding: 0,
    width: "70%",
    padding: "50px 0"
  },
  topdivdiv: {
    fontFamily: "arial black",
    fontWeight: 600,
    fontSize: 100,
    willChange: "opacity",
  },
  icon: {
    fontSize: 60,
    display: "block",
    margin: "0 auto",
  },
  menutext: {
    margin: "0 auto",
    fontSize: 30,
    textAlign: "center",
    cursor: "pointer",
    transition: "1s"
  },
  menutextHovered: {
    margin: "0 auto",
    fontSize: 40,
    textAlign: "center",
    cursor: "pointer",
    color: purple[800],
    transition: "1s"
  },
});

const Aboutme=()=>{
  const classes = useStyles();
  
  return(
    <div>
      <h1 style={{margin: 0}}>About me</h1>
      <p>出生</p>
    </div>    
  );
}
export default Aboutme;
